import React, { useEffect, useState } from 'react';
import { useNavigate } from "react-router-dom";
import { Button } from 'antd';
import axios from 'axios';

const AdministracionDeCuentasAjustador = () => {
  const navigate = useNavigate();
  const [nombres, setNombres] = useState('');

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/Login');
  };

  useEffect(() => {
    const Id = localStorage.getItem('Id_Usuario');
    const token = localStorage.getItem('token');

    const obtenerImagenDeUsuario = async () => {
      try {
        const response = await axios.get(`http://localhost:8000/Ajustadores/ConsultarAjustadoresPorId/${encodeURIComponent(Id)}`, {
          headers: {
            'Authorization': token
          }
        });
        console.log("Respuesta de la consulta:", response.data);

        // Verificar si la respuesta contiene registros válidos
        if (response.data && response.data.registro && response.data.registro.length > 0) {
          // Acceder al primer registro (asumiendo que solo hay uno por el endpoint especificado)
          const primerRegistro = response.data.registro[0];
          // Actualizar el estado con los nombres del ajustador del primer registro
          setNombres(primerRegistro.Nombres);
        } else {
          console.error('No se encontraron datos válidos en la respuesta');
        }
      } catch (error) {
        console.error('Error al obtener la información del ajustador:', error);
      }
    };

    obtenerImagenDeUsuario();
  }, []);

  return (
    <div style={{ padding: '20px' }}>
      <h1>Administración de Cuentas de Ajustador</h1>
      <div>
        <p>Bienvenido, {nombres}</p>
        <Button type="primary" onClick={handleLogout} style={{ marginRight: 16 }}>
          Cerrar Sesión
        </Button>
      </div>
    </div>
  );
};

export default AdministracionDeCuentasAjustador;
